def unscramble(cypher):
    # Initialize an empty list to store the outer hex values
    outer_hex_values = []

    # Iterate through each element in the cypher list
    for item in cypher:
        # Extract the outer hex values (first and last elements of each sublist)
        if isinstance(item, list) and len(item) > 0:
            # First element is always a hex value
            outer_hex_values.append(item[0])
            # Last element is also a hex value (if it's a string and starts with '0x')
            if isinstance(item[-1], str) and item[-1].startswith('0x'):
                outer_hex_values.append(item[-1])

    # Print the outer hex values, one pair per line
    for i in range(0, len(outer_hex_values), 2):
        print(outer_hex_values[i], outer_hex_values[i+1])

